# Parse test output to extract meaningful data
def parse_test_output(output):
    try:
        # Extract key metrics from test output
        total_tests_match = re.search(r'Total Tests: (\d+)', output)
        passed_match = re.search(r'‚úÖ Passed: (\d+)', output)
        failed_match = re.search(r'‚ùå Failed: (\d+)', output)
        success_rate_match = re.search(r'Success Rate: ([\d.]+)%', output)
        status_match = re.search(r'‚ö†Ô∏è Overall Status: (\w+)', output)

        total_tests = int(total_tests_match.group(1)) if total_tests_match else 0
        passed = int(passed_match.group(1)) if passed_match else 0
        failed = int(failed_match.group(1)) if failed_match else 0
        success_rate = float(success_rate_match.group(1)) if success_rate_match else 0
        status = status_match.group(1) if status_match else 'UNKNOWN'

        # Extract failed test details
        failed_tests = re.findall(r'‚ùå (test_\w+) - failed', output)

        return {
            'ok': True,
            'summary': {
                'total_tests': total_tests,
                'passed': passed,
                'failed': failed,
