// Parse the collected test reports
const originalStdout = $json.stdout || '{}';
let testReports = {}; 

const timestamp = new Date().toISOString();
const sessionId = `automatos-testing-${Date.now()}`;

// Function to log to console with session info
function logTrace(message) {
  const logEntry = `${timestamp} [${sessionId}] CALCULATE: ${message}`;
  console.log(logEntry);
}

logTrace('üîç TRACE: Calculate Node Starting');
logTrace(`üì• INPUT: stdout length: ${originalStdout.length}`);
logTrace(`üì• INPUT: First 200 chars: ${originalStdout.substring(0, 200)}`);

try { 
  testReports = JSON.parse(originalStdout); 
  logTrace(`‚úÖ PARSE: Successfully parsed JSON, keys: ${Object.keys(testReports).join(', ')}`);
} catch(e){ 
  logTrace(`‚ùå PARSE: Failed to parse stdout: ${e.message}`);
  testReports = {}; 
} 

const groups = ['agents','workflows','context','knowledge','playbooks','settings','analytics','context_policy','code_graph','playbooks_api','patterns']; 
const fails = []; 
let totalTests = 0, totalPassed = 0; 

// Process each test module report
for (const group of groups) {
  const report = testReports[group];
  const groupInfo = `${report ? 'found' : 'missing'} ${report?.summary ? `${report.summary.total_tests} tests` : 'no summary'}`;
  logTrace(`üìä GROUP ${group}: ${groupInfo}`);

  if (!report || report.ok === false) {
    fails.push(group + ' (missing/error)');
    continue;
  }

  // Check if this group has test results
  if (report.summary) {
    const summary = report.summary;
    totalTests += summary.total_tests || 0;
    totalPassed += summary.passed || 0;

    // Mark as failed if success rate < 85% or status is failed
    const groupSuccessRate = summary.success_rate || 0;
    if (groupSuccessRate < 85 || summary.status === 'failed') {
      fails.push(group + ` (${groupSuccessRate.toFixed(1)}%)`);
    }
  } else {
    fails.push(group + ' (no summary)');
  }
}

const overallSuccessRate = totalTests > 0 ? (totalPassed / totalTests) * 100 : 0;
const needsAI = overallSuccessRate < 85 || fails.length > 0;

logTrace(`üéØ RESULT: ${totalPassed}/${totalTests} tests passed (${overallSuccessRate.toFixed(1)}%), needsAI=${needsAI}`);
logTrace(`‚ùå FAILED: ${fails.join(', ')}`);
logTrace(`üì§ OUTPUT: Routing to ${needsAI ? 'AI Analysis' : 'Success Path'}`);

const result = { 
  ok: !needsAI, 
  fails, 
  aggregate: testReports, 
  stdout: originalStdout,
  successRate: overallSuccessRate, 
  totalTests, 
  totalPassed, 
  needsAI,
  debug: {
    hasOriginalStdout: !!originalStdout,
    stdoutLength: originalStdout.length,
    parsedGroups: Object.keys(testReports),
    failedGroupsCount: fails.length
  }
};

logTrace(`üîç TRACE: Calculate Node Complete, output keys: ${Object.keys(result).join(', ')}`);
return [{ json: result }];

