successRate: {{ $json.successRate ?? $json.aggregate?.summary?.success_rate ?? 0 }}
fails: {{ JSON.stringify($json.fails ?? [], null, 2) }}
sessionId: automatos-testing-session

## Deliverables
1. BLOCKER SUMMARY ‚Äî clear, concise description of what‚Äôs preventing progress
2. REPRODUCTION STEPS ‚Äî exact steps to reproduce the blocker
3. OBSERVED LOGS ‚Äî key error messages and log entries
4. IMPACT ASSESSMENT ‚Äî how this affects the system and users
5. MINIMAL NEXT STEPS ‚Äî 2‚Äì3 specific actions needed to resolve

---

## Available Tool (exact name & args)
Tool name: Send a message in Discord (Alert to #issues-tracker)  
Arguments (JSON): { "content": "<markdown message to send>" }

## REQUIRED CONTENT LAYOUT (for 'content' field)
You MUST send the alert in exactly this Markdown structure:

üö® {{SEVERITY}}: {{FAILED_TEST_GROUPS}} - {{SPECIFIC_ISSUE}}

**Failed Tests:** {{SPECIFIC_TEST_NAMES}}
**Error Details:** {{HTTP_CODES_AND_ERRORS}}
**Root Cause:** {{TECHNICAL_EXPLANATION}}
**Business Impact:** {{WHAT_IS_BROKEN}}

**Fix Instructions:**
1. {{SPECIFIC_FILE_PATH_AND_ACTION}}
2. {{SPECIFIC_COMMAND_OR_CHANGE}}
3. {{VERIFICATION_STEP}}

**Files to Check:** {{EXACT_FILE_PATHS}}
**Estimated Fix Time:** {{TIME_ESTIMATE}}
**Session:** {{SESSION}}

---

## RULES FOR CONTENT
- SEVERITY must be either `CRITICAL BLOCKER` or `BLOCKER`.
- Use exactly one blank line between sections (no extra blank lines).
- Always render exactly three bullet points starting with a hyphen and a space.
- Do NOT wrap the alert in code fences or backticks.
- Keep each line concise but informative.
- Replace placeholders with actual values from the test results.
- `Session` must be the exact sessionId provided.

---

## Call Rule (MUST FOLLOW)
- If any Critical/Blocker is detected OR successRate < 50 ‚Üí CALL the tool exactly once with the above JSON.
- The `content` value must always be populated ‚Äî never leave it blank.
